import './App.css';
import {
  Routes ,
  Route,
} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Admin <code>Sales</code> and Social APP.
        </p>
        <a
          // className="App-link"
          // href="https://reactjs.org"
          // target="_blank"
          // rel="noopener noreferrer"
        >
           <Routes>
          <Route path="/Home" element={<Home/>} />
          </Routes>
          <Link to="/">Home</Link>
          {/* Bắt đầu */}
        </a>
      </header>
    </div>
  );
}

export default App;

function Home() {
  return (
    <div>
      <h2>Home</h2>
    </div>
  );
}
